import axios from "axios";
import { useState } from "react";

const axiosControl = () => {
  axios.interceptors.response.use(
    (res) => {
      return res;
    },
    (e) => {
      if (e.response.status === 401) {
        throw `401 - Unauthorized\n${e.response?.data}`;
      } else {
        return e;
      }
    }
  );
};
export const init = () => {
  axiosControl();
  //   alert("IN");
};
